        super(props);
    }
    render() {
        return (


            <PageContentWallpaper {...this.props} >

                <div className="row">

                    <div className="col-xs-12">
                        <h2>Category Setting</h2>
                    </div>

                </div>



            </PageContentWallpaper>


        );
    }
}
